description:
Categories Feature, Prebooks, Romance

Cast Scarlet Red, Veronica Avluv, Sara Luvv, Jay Smooth, Danny Mountain, Michael Vegas, Eric Masterson

From An Original Story by Stormy Daniels.
20 something Christina has a dilemma. She was swept off her feet by a much older man, but now things have cooled. What was once exciting and new has come to represent a commitment she's not willing to make. Enter two well-meaning parents with a charming son and designs on matchmaking and very soon sparks are flying again! When the time is right, you just know... Perfect.
